import React ,{useEffect}from 'react';
import Nav from '../nav.css'
import { Link } from 'react-router-dom';
const Adminnav = () => {

  useEffect(()=>{
    const btn = document.querySelector("#button");
    const navdisp = document.getElementById("navi");
    
    
    
    btn.addEventListener("click", ()=>{
        navdisp.classList.toggle("active");
        btn.classList.toggle("activebutton");
    } )
    
  },[])
    return ( 
      <React.Fragment>
      <button type ="submit"id="button">&#9776;</button>
        <nav id="navi" className=" navbar  navbar-expand-lg mt-4 jumbotron ">
     
   <ul class="  flex-column">
  <li class="nav-item ">
    <Link to='/addproduct'>Add product</Link>
  </li>
  <li class="nav-item ">
    <Link class="nav-link " >All Products</Link>
  </li>
  <li class="nav-item  ">
    <Link class="nav-link  ">View Users</Link>
  </li>
 
</ul>
        </nav>
        </React.Fragment>
     );
}
 
export default Adminnav;
